        self.__next_f.push([1,"1c:[\"$\",\"section\",null,{\"id\":\"testimonials\",\"className\":\"pb-20 sm:pb-32\",\"children\":[\"$\",\"div\",null,{\"className\":\"container\",\"children\":[[\"$\",\"header\",null,{\"className\":\"mx-auto mb-6 max-w-(--breakpoint-sm) text-center lg:mb-12\",\"children\":[null,[\"$\",\"h2\",null,{\"className\":\"mb-4 text-3xl font-bold md:text-4xl\",\"children\":\"Apa Kata Mereka\"}],[\"$\",\"p\",null,{\"className\":\"text-muted-foreground mb-8 text-lg\",\"children\":\"Simak Pendapat Siswa Mengenai Program Belajar di NF.\"}]]}],[\"$\",\"$L2e\",null,{\"testi\":[{\"id\":11,\"documentId\":\"kfco654j7t172vbab29fsv5j\",\"name\":\"Keisha Firzanah\",\"acceptedIn\":\"Ilmu Komunikasi - UNDIP\",\"fromNF\":\"245-Semarang\",\"fromSchool\":\"SMAIT Ibnu Abbas Klaten\",\"isVideo\":null,\"video\":null,\"comment\":\"Belajar bareng disini literally ngubah POV aku yang dulu mikirnya harus ngoyo dan begadang tiap malem, ternyata belajar bisa fun, santai, tapi tetep nempel di otak!! Bimble di NF tuh bukan cuma perkara 'bisa ngerjain soal', tapi juga soal mental battle menghadapi UTBK. Dari yang awalnya clueless banget ngerjain latsol (((APALAGI PK PM  ))) akhirnya jadi makin paham dan bisa atur strategi biar otak ga burnout tapi ttp maksimal, mental terjaga, dan nilai aman sentosa. ANDD Alhamdulillah hasilnya manis banget, lolos UTBK with peace of mind. Big love for NF \",\"createdAt\":\"2025-07-25T03:12:38.022Z\",\"updatedAt\":\"2025-07-26T07:33:55.048Z\",\"publishedAt\":\"2025-07-26T07:33:55.070Z\",\"image\":{\"id\":25,\"documentId\":\"jgio9idpcnegc27udykiu2vt\",\"url\":\"https://nos.nurulfikri.id/myops/cms-portal/Keisha_Firzanah_Adinda_Yanda_fc4a119f77.jpeg\"}},{\"id\":12,\"documentId\":\"yt6syqjatvadwelg3b9o9z8v\",\"name\":\"Shan Alif Ramadhan\",\"acceptedIn\":\"Ilmu Hukum - UI\",\"fromNF\":\"254-Graha Raya\",\"fromSchool\":\"SMAS Syafana\",\"isVideo\":true,\"video\":\"https://youtube.com/shorts/LqTD7snlMvA?feature=share\",\"comment\":\"Belajar di NF itu worth it banget. Kakak pengajarnya baik-baik, tempat belajarnya nyaman, ilmu nya dijamin sampe. Berkat NF aku jadi bisa lolos di SNBT UTBK.\",\"createdAt\":\"2025-07-25T03:15:04.990Z\",\"updatedAt\":\"2025-07-26T07:34:08.629Z\",\"publishedAt\":\"2025-07-26T07:34:08.654Z\",\"image\":{\"id\":26,\"documentId\":\"rqxsad5mosl8d19cj799e2ka\",\"url\":\"https://nos.nurulfikri.id/myops/cms-portal/Shan_Alif_Ramadhan_b838f8eeeb.png\"}},{\"id\":13,\"documentId\":\"bo5kyif13ykes5kv76bukho7\",\"name\":\"Pusparani Ritonga\",\"acceptedIn\":\"STEI - ITB\",\"fromNF\":\"262-Cikupa\",\"fromSchool\":\"SMAN CMBBS\",\"isVideo\":true,\"video\":\"https://youtube.com/shorts/Pt4RAkBHxDQ?feature=share\",\"comment\":\"Belajar di NF tuh seru banget gurunya asik dan penjelasannya mudah dipahami. Terus banyak latihan soal juga yang bikin kita tuh jadi lebih menguasai materi yang dijelaskan.\",\"createdAt\":\"2025-07-25T03:17:45.471Z\",\"updatedAt\":\"2025-07-26T07:34:25.577Z\",\"publishedAt\":\"2025-07-26T07:34:25.592Z\",\"image\":{\"id\":27,\"documentId\":\"xferhbwg7c0ng2j34sbdvjgm\",\"url\":\"https://nos.nurulfikri.id/myops/cms-portal/Pusparani_Ritonga_fd813bf181.png\"}},{\"id\":14,\"documentId\":\"h8lboihzi2qpioudfnw5v8qo\",\"name\":\"Amalia Keiza\",\"acceptedIn\":\"Manajemen - UGM\",\"fromNF\":\"237-Tasikmalaya\",\"fromSchool\":\"SMA AL MUTTAQIN\",\"isVideo\":true,\"video\":\"https://www.youtube.com/shorts/94rqtaPzdgc\",\"comment\":\"NF The Best!\",\"createdAt\":\"2025-07-25T03:19:35.271Z\",\"updatedAt\":\"2025-07-26T07:34:58.770Z\",\"publishedAt\":\"2025-07-26T07:34:58.785Z\",\"image\":{\"id\":28,\"documentId\":\"gcft1mnysbfqxxib2f8ej4c7\",\"url\":\"https://nos.nurulfikri.id/myops/cms-portal/Amalia_Keiza_44c9011a68.jpeg\"}},{\"id\":15,\"documentId\":\"h0tfabsmdmsa3omv258g3a99\",\"name\":\"Mukhlas Azman\",\"acceptedIn\":\"Kedokteran - UI\",\"fromNF\":\"237-Tasikmalaya\",\"fromSchool\":\"SMAN 2 Tasikmalaya\",\"isVideo\":true,\"video\":\"https://www.youtube.com/shorts/JdNYZBTB54s\",\"commen