tlh\",\"title\":\"Modul Cetak Zuperbook\",\"description\":\"Rangkuman materi dan kumpulan rumus yang mendukung sumber belajar siswa serta telah terhubung dengan modul digital aplikasi SIP NF\",\"jenjang\":\"ALL\",\"createdAt\":\"2025-07-24T10:27:15.020Z\",\"updatedAt\":\"2025-08-27T06:59:17.902Z\",\"publishedAt\":\"2025-08-27T06:59:17.961Z\",\"grade\":\"All\",\"image\":{\"id\":16,\"documentId\":\"o628i2vggprezpx47hd4bgo6\",\"url\":\"https://nos.nurulfikri.id/myops/cms-portal/feature_zuperbook_d5cfca3873.png\"}},{\"id\":37,\"documentId\":\"fdsv5xit0trv7489aj5gqwas\",\"title\":\"Suplemen Materi Terpadu (SMART)\",\"description\":\"Bahan pelajaran tambahan yang dirancang untuk melengkapi materi yang sudah dipelajari di sekolah. Merupakan bagian dari program bimbingan belajar Nurul Fikri yang bertujuan untuk meningkatkan pemahaman dan kemampuan siswa dalam berbagai mata pelajaran\",\"jenjang\":\"ALL\",\"createdAt\":\"2025-07-24T10:27:57.517Z\",\"updatedAt\":\"2025-08-27T06:59:28.658Z\",\"publishedAt\":\"2025-08-27T06:59:28.680Z\",\"grade\":\"All\",\"image\":{\"id\":17,\"documentId\":\"n8w1rvxmlr0rgja4csu7s37z\",\"url\":\"https://nos.nurulfikri.id/myops/cms-portal/feature_SMART_bab0d884a9.png\"}},{\"id\":38,\"documentId\":\"gv7jx7k46e34v5tyt0uvgylh\",\"title\":\"Modul Digital Interaktif\",\"description\":\"Aplikasi Sistem Informasi Pembelajaran (SIP), telah dilengkapi modul dan ribuan soal pelatihan interaktif beserta video pembelajaran, Try Out SNBT dengan model terbaru, Personalisasi tes sesuai kebutuhan belajar, Leaderboard kelas dan nasional, Portofolio siswa, Akses monitoring untuk orang tua siswa, serta Rekomendasi belajar berdasarkan hasil asesmen (gaya belajar, potensi kecerdasan, dan keahlian yang diminati)\",\"jenjang\":\"ALL\",\"createdAt\":\"2025-07-24T10:29:14.168Z\",\"updatedAt\":\"2025-08-27T06:59:40.941Z\",\"publishedAt\":\"2025-08-27T06:59:40.955Z\",\"grade\":\"All\",\"image\":{\"id\":18,\"documentId\":\"zvk4ek8ni8bgr9a1rxtu5a6p\",\"url\":\"https://nos.nu